import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <BrowserRouter>
    {
        routers.map(router=>{
            return (
                <Route
                    path={router.path}
                    component = { router.component }
                ></Route>
            )
        })
    }
    </BrowserRouter>
  );
}

export default App;
